package loop1216;

public class Loop_T02_02 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("----------------------");
		System.out.println("5의 배수 출력 프로그램 v1.0");
		System.out.println("----------------------");
		int i = 0;
		while (i<=100) {
			if (i % 5 == 0) {
				System.out.println(i);				
			}
			i++;
		}
		
	}

}


